import React, { useState, useEffect } from "react";
import {
  Paper,
  TextField,
  Button,
  Avatar,
  CircularProgress,
  InputLabel,
  Select,
  Input,
  FormControl,
  MenuItem
} from "@material-ui/core";
import Alert from "@material-ui/lab/Alert";
import CloseIcon from "@material-ui/icons/Close";
import IconButton from "@material-ui/core/IconButton";
import Collapse from "@material-ui/core/Collapse";
// styles
import useStyles from "./styles";

// components
import { Typography } from "../../components/Wrappers";
import { goods } from "../../context/UserContext";
import {
  showIdentification,
  showName,
  showDependence,
  showDependenceName,
  getDependenceByFk,
  getDependences,
  saveGood,
  dependence,
  campus
} from "../../context/UserContext";


export default function Dashboard(props) {
  var classes = useStyles();
  var [isLoading, setIsLoading] = useState(false);
  var [namegoodValue, setNamegoodValue] = useState("");
  var [descriptionValue, setDescriptionValue] = useState("");
  var [plateValue, setPlateValue] = useState("");
  var [placeValue, setPlaceValue] = useState("");
  var [physicalspaceValue, setPhysicalspaceValue] = useState("");
  var [brandValue, setBrandValue] = useState("");
  var [stateValue, setStateValue] = useState("");
  var [reasonValue, setReasonValue] = useState("");
  var [answer, setAnswer] = useState(null);
  var [error, setError] = useState(null);
  var [open, setOpen] = useState(true);
  var [dependencia, setDependencia] = useState("");
  var [sede, setSede] = useState("");
  var [type, setType] = useState("");

  // if (typeof goods == undefined) {
  //   listItems =   <li>Sin registros</li>
  // } else {
  //   listItems = goods.map((number) => <li>{number.name}</li>);
  // }

  // useEffect(() => {
  //   console.log("variables updating")
  // }, [namegoodValue,descriptionValue,plateValue,placeValue])


  // const getDependencesList = () =>{

  //   getDependences(setIsLoading)

  // }

  useEffect(() => {
    console.log("HOLAAAAA")
    updateDependence();
    return () => console.log("Updating dependence")
  }, [])


  const updateDependence = () =>{
    console.log("calling something")
      getDependenceByFk(setIsLoading);

  }

  // useEffect(() => {
  //   getDependencesList();
  //   return () => console.log("getting dependences");
  // }, [])


  const handleChangev2 = (event) => {
    var iddep = event.target.value;
    setDependencia(iddep);
    //const result = getDependenceByFk(iddep.id)
    //console.log("SUPER SEDE", result)
    //setDependencia(result)
  };

  const handleChangev3 = (event) => {
    setSede(event.target.value);
  }

  const handleChange = (event) => {
    setType(event.target.value);
  };

  return (
    <>
      <Paper
        variant="elevation"
        elevation={5}
        className={classes.principalContainer}
        square={false}
      >
        <div className={classes.formContainer}>
          <div className={classes.form}>
            <Typography variant="h2" className={classes.title}>
             Ingreso de bien
            </Typography>

            <TextField
              id="name"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              disabled={true}
              margin="normal"
              placeholder={showName}
              label={showName}
              variant="outlined"
            />
            <TextField
              id="identification"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              disabled={true}
              margin="normal"
              placeholder="Número de identificación"
              label={showIdentification}
              variant="outlined"
            />
            <div className={classes.list}>
              <FormControl className={classes.formControl} variant="outlined">
                <InputLabel
                  id="demo-mutiple-name-label"
                  className={classes.label}
                >
                  Dependencia
                </InputLabel>
                <Select
                  labelId="demo-mutiple-name-label"
                  id="demo-mutiple-name"
                  value={dependencia}
                  onChange={handleChangev2}
                  input={<Input />}

                >
                  {dependence.map((name) => (
                    <MenuItem key={name} value={name}>
                      {name.nombre_dependencia}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl className={classes.formControl} variant="standard">
                <InputLabel
                  id="demo-mutiple-name-label"
                  className={classes.label}
                >
                  Tipo de comprobante
                </InputLabel>
                <Select
                  labelId="demo-mutiple-name-label"
                  id="demo-mutiple-name"
                  value={type}
                  onChange={handleChange}
                  input={<Input />}

                >
                <MenuItem value={10}>Entrada</MenuItem>
                <MenuItem value={20}>Salida</MenuItem>
                </Select>
              </FormControl>
            </div>           
            <Typography variant="h2" className={classes.title}>
              Bienes a registrar
            </Typography>
            <TextField
              id="nameGood"
              className={classes.inputs}
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={namegoodValue}
              onChange={(e) => setNamegoodValue(e.target.value)}
              label="Nombre del bien"
              placeholder="Nombre del bien"
              variant="outlined"
            />
            <TextField
              id="descripcion"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={descriptionValue}
              onChange={(e) => setDescriptionValue(e.target.value)}
              label="Descripción"
              placeholder="Descripción"
              variant="outlined"
            />
            <TextField
              id="placa"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={plateValue}
              onChange={(e) => setPlateValue(e.target.value)}
              label="Placa"
              placeholder="Placa"
              variant="outlined"
            />
            <TextField
              id="Sede"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={placeValue}
              onChange={(e) => setPlaceValue(e.target.value)}
              label="Sede"
              placeholder="Sede"
              variant="outlined"
            />
            <TextField
              id="Espacio"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={physicalspaceValue}
              onChange={(e) => setPhysicalspaceValue(e.target.value)}
              label="Espacio Físico"
              placeholder="Espacio Físico"
              variant="outlined"
            />
            <TextField
              id="Marca"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={brandValue}
              onChange={(e) => setBrandValue(e.target.value)}
              label="Marca y Serie"
              placeholder="Marca y Serie"
              variant="outlined"
            />
            <TextField
              id="Estado"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={stateValue}
              onChange={(e) => setStateValue(e.target.value)}
              label="Estado"
              placeholder="Estado"
              variant="outlined"
            />
            <TextField
              id="Motivo"
              InputProps={{
                classes: {
                  input: classes.textField,
                },
              }}
              value={reasonValue}
              onChange={(e) => setReasonValue(e.target.value)}
              label="Motivo Ingreso"
              placeholder="Motivo Ingreso"
              variant="outlined"
            />
              <FormControl className={classes.formControl} variant="outlined">
                <InputLabel
                  id="demo-mutiple-name-label"
                  className={classes.label}
                >
                  Sede
                </InputLabel>
                <Select
                  labelId="demo-mutiple-name-label"
                  id="demo-mutiple-name"
                  value={sede}
                  onChange={handleChangev3}
                  input={<Input />}

                >
                  {campus.map((name) => (
                    <MenuItem key={name} value={name}>
                      {name.nombre}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            {isLoading ? (
              <CircularProgress size={26} className={classes.loginLoader} />
            ) : (
              <Button
                disabled={
                  namegoodValue === "" ||
                  descriptionValue === "" ||
                  plateValue === "" ||
                  placeValue === "" ||
                  physicalspaceValue === "" ||
                  brandValue === "" ||
                  stateValue === "" ||
                  reasonValue === ""
                }
                onClick={() => {
                  saveGood(
                    namegoodValue,
                    descriptionValue,
                    plateValue,
                    placeValue,
                    physicalspaceValue,
                    brandValue,
                    stateValue,
                    reasonValue,
                    props.history,
                    setIsLoading,
                    setError,
                    setAnswer
                  );
                  alert("Datos enviados");
                }}
                variant="contained"
                color="secondary"
                className={classes.addButton}
                startIcon={
                  <Avatar
                    src="https://www.freeiconspng.com/thumbs/check-tick-icon/tick-icon-30.png"
                    className={classes.iconC}
                  />
                }
              ></Button>
            )}
          </div>
        </div>
        {answer ? (
          <Collapse in={open}>
            <Alert
              severity="error"
              action={
                <IconButton
                  aria-label="close"
                  color="inherit"
                  size="small"
                  onClick={() => {
                    setOpen(false);
                  }}
                >
                  <CloseIcon fontSize="inherit" />
                </IconButton>
              }
            >
              Algó pasó verifica los datos
            </Alert>
          </Collapse>
        ) : (
          <Typography
            color="secondary"
            className={classes.errorMessage}
          ></Typography>
        )}
      </Paper>
    </>
  );
}
